app.controller("quescreen-cont",["$scope","$http",function(a,b){a.sendok=function(){a.answer=1;b.get("/services/answers/"+a.params.gameId+"/"+a.params.queId+"/"+a.answer).then(function(c){a.respond=c.data})};a.sendno=function(){a.answer=0;b.get("/services/answers/"+a.params.gameId+"/"+a.params.queId+"/"+a.answer).then(function(c){a.respond=c.data})};a.$on("$locationChangeStart",function(){b.get("/services/back"+a.gameid+"/"+a.numin)})}]);